import React from "react";
import "./style.css";



const FighterCards = props => (
  <div 
  id={props.name}
   className="card col-md-3">
    <div className="img-container">
      <img alt={props.name} src={props.image} />
      <button onClick={props.score}>+1</button> 
    </div>
  </div>
);


export default FighterCards;
